using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace LeetCodeTests.Hard
{
    [TestClass]
    public class FindShortestPalindrome
    {
        private LeetCode.Hard.FindShortestPalindrome Find => new LeetCode.Hard.FindShortestPalindrome();

        [TestMethod]
        public void FindShortestPalindrome_01() =>
            Assert.AreEqual(
                "aaa",
                Find.ShortestPalindrome("aaa"));

        [TestMethod]
        public void FindShortestPalindrome_02() =>
            Assert.AreEqual(
                "fdsasdf",
                Find.ShortestPalindrome("asdf"));

        [TestMethod]
        public void FindShortestPalindrome_03() =>
            Assert.AreEqual(
                "aacaaacaa",
                Find.ShortestPalindrome("aaacaa"));

        [TestMethod]
        public void FindShortestPalindrome_04() =>
            Assert.AreEqual(
                "",
                Find.ShortestPalindrome(""));
    }
}